import React from 'react';
import { useSelector } from 'react-redux';

function Edit() {
  const { username, email, lastName } = useSelector(({ registration }) => registration.currentUser);

  return (
    <div className="container">
      <p> Личный кабинет </p>
      <input type="text" value={username} />
      <input type="text" value={lastName} />
      <input type="email" value={email} />
      <input type="password" value={'dsdsadsad'} />
    </div>
  );
}

export default Edit;
